import React, {useState} from 'react';
import {styles} from './EmojiPage.style';
import {Image} from 'react-native-elements';
import {Text, TouchableOpacity, View} from 'react-native';

const EmojiPage = () => {
  const emojis = [
    {
      caption: 'Like',
      uri: 'https://www.pngfind.com/pngs/m/38-381410_facebook-like-emoji-png-transparent-png.png',
    },
    {
      caption: 'Love',
      uri: 'https://logowik.com/content/uploads/images/facebook-love-emoji.jpg',
    },
    {
      caption: 'Haha',
      uri: 'data:image/jpeg;base64,',
    },
    {
      caption: 'Yay',
      uri: 'data:image/png;base64,',
    },
    {
      caption: 'Wow',
      uri: 'data:image/png;base64,',
    },
    {
      caption: 'Sad',
      uri: 'https://clipart.info/images/ccovers/1499793247facebook-sad-emoji-like-png.png',
    },
    {
      caption: 'Angry',
      uri: 'data:image/jpeg;base64,',
    },
  ];
  const [showBlock, setShowBlock] = useState(false);
  const [selectedImage, setSelectedImage] = useState(
    'https://www.pngfind.com/pngs/m/38-381410_facebook-like-emoji-png-transparent-png.png',
  );

  return (
    <View style={styles.pageStyle}>
      <View>
        <TouchableOpacity
          onPress={() => setShowBlock(true)}
          style={styles.imageStyle}>
          <Image
            style={styles.tinyLogo}
            source={{
              uri: selectedImage,
            }}
          />
        </TouchableOpacity>
      </View>
      {showBlock && (
        <View style={styles.emojis}>
          {emojis.map((emoji, key) => (
            <TouchableOpacity
              key={key}
              onPress={() => {
                setSelectedImage(emoji.uri);
                setShowBlock(false);
              }}>
              <Image
                style={styles.tinyLogo}
                source={{
                  uri: emoji.uri,
                }}
              />
              <Text style={styles.textStyle}>{emoji.caption}</Text>
            </TouchableOpacity>
          ))}
        </View>
      )}
    </View>
  );
};

EmojiPage.propTypes = {};

EmojiPage.defaultProps = {};

export default EmojiPage;
